import React from "react"


class VideoItem extends React.Component {
    constructor(props) {
        super(props)
    }
    render() {
        return (
            <div className="item">
                <img
                    src={this.props.video.snippet.thumbnails.default.url}
                    className="ui image">
                </img>
                <div className="content">
                    <p className="header">{this.props.video.snippet.title}</p>
                    <p className="description">{this.props.video.snippet.description}</p>
                </div>
            </div>)
    }
}


export default VideoItem
